      '14_File/Main.tonyu': 'saveDataFile=file("save.json");\nsaveData=saveDataFile.obj();\nif (!saveData) saveData={count:0};\nsaveData.count++;\nsaveDataFile.obj(saveData);\nx=200;y=20;size=20;\ntext="count="+saveData.count+" F9:inc SPACE:reset";\nwhile (true) {\n    if (getkey("space")==1) {\n        saveDataFile.rm();\n        text="Reset ! press F9";\n    }\n    update();    \n}\n\n\n\n',
