      '15_Box2D/.desktop': '{"runMenuOrd":["Main","B2Body"]}',
      '15_Box2D/Ball.tonyu': 'extends BodyActor;\n\nwhile(y<450) {\n    // 物理オブジェクトにぶつかっていれば\n    if (c=contactTo()) {\n        // スペースキーを押したときに上に瞬間的な力を加える\n        if (getkey("space")==1) applyImpulse(0,-5);\n    }\n    // 左右キーを押したときにゆっくりと力を加える\n    if (getkey("left")) applyForce(-5,0);\n    if (getkey("right")) applyForce(5,0);\n    update();\n}\ndie();',
      '15_Box2D/Block.tonyu': 'extends BodyActor;\nwhile(!screenOut()) {\n    update();   \n}\ndie();',
      '15_Box2D/Main.tonyu': '// 物理エンジンの利用\n// BodyActorクラスまたはBodyActorクラスを継承したオブジェクトを置く\n\nprint("Use ← → and Space");\n// プレイヤー（ボール)  shape: 丸い形状の物体\nnew Ball{x:100,y:50,shape:"circle",p:12};\n// 床  isStatic:true  動かない物体\nnew T2Body{x:230,y:400,p:$pat_floor+0,\nscaleX:10,scaleY:1,isStatic:true};\n\nwhile (true) {\n    new Block{x:rnd()*400,y:0,p:$pat_floor,\n    scaleX:3,scaleY:1,rotation:rnd(360)};\n    updateEx(60);\n}\n',
